"use strict";

var sum = function sum(a, b) {
    return a + b;
};
var sub = function sub(a, b) {
    return a - b;
};
var mul = function mul(a, b) {
    return a * b;
};
var div = function div(a, b) {
    return a / b;
};
console.log("sum of two number is " + sum(10, 20));
console.log("sub of two number is " + sub(100, 20));
console.log("mul of two number is " + mul(1, 20));
console.log("div of two number is " + div(100, 20));
